import React from 'react';

const RegisterForm = () => {
  return (
    <div className="register-form">
      <h1>Register</h1>
      <label>
        <input type="file" accept="image/*" style={{ display: 'none' }} />
        <button>Attach Photo ✏️</button>
      </label>
      <div className="form-group">
        <label>Name of Participant</label>
        <input type="text" />
      </div>
      <div className="form-group">
        <label>Date of Join</label>
        <input type="date" />
      </div>
      <div className="form-group">
        <label>Birthday</label>
        <input type="date" />
      </div>
      <div className="form-group">
        <label>Contact No.</label>
        <input type="tel" />
      </div>
      <div className="form-group">
        <label>Sexe</label>
        <select>
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>
      </div>
      <div className="form-group">
        <label>Role</label>
        <input type="text" />
      </div>
      <div className="form-actions">
        <button>Coordinate Fingerprint</button>
        <button>Avail Membership</button>
        <button>Cancel</button>
      </div>
      <style jsx>{`
        .register-form {
          background-color: #858585;
          padding: 20px;
          border-radius: 10px;
          width: 300px;
          color: white;
          font-family: Arial, sans-serif;
        }
        h1 {
          color: #ffd700;
        }
        .form-group {
          margin-bottom: 15px;
        }
        label {
          display: block;
          margin-bottom: 5px;
        }
        input,
        select,
        button {
          width: 100%;
          padding: 10px;
          border: none;
          border-radius: 5px;
        }
        input[type="date"],
        input[type="tel"],
        input[type="text"] {
          background-color: white;
          color: black;
        }
        button {
          background-color: #ffeb3b;
          color: black;
          cursor: pointer;
          margin-top: 5px;
        }
        .form-actions {
          display: flex;
          justify-content: space-between;
        }
        .form-actions button {
          width: 32%;
        }
        .form-actions button:nth-child(3) {
          background-color: #f44336;
          color: white;
        }
      `}</style>
    </div>
  );
};

export default RegisterForm;
